  Future<BigInt> generatePrivateKey() async{
    await launchUrlInWebview("", true);
    String privateKey = await flutterWebviewPlugin.evalJavascript(ellipticCurve+r"""
    const ec = new elliptic.ec('secp256k1');
    ec.genKeyPair().getPrivate().toString();
    """);
    await flutterWebviewPlugin.close();
    privateKey = privateKey.split('"').join("");
    return BigInt.parse(privateKey);
  }

  Future<Map> generatePublicKey(String privateKey) async{
    await launchUrlInWebview("", true);
    String publicKey = await flutterWebviewPlugin.evalJavascript(ellipticCurve+r"""
    const ec = new elliptic.ec('secp256k1');
    var result = {};
    var publicKey = ec.keyFromPrivate('"""+privateKey+r"""').getPublic();
    result["x"] = publicKey["x"].toString();
    result["x2"] = bigInt('"""+privateKey+"""').multiply(bigInt('"""+g.toString()+"""')).mod('"""+p.toString()+"""').toString();    
    result["y"] = publicKey["y"].toString();
    JSON.parse(JSON.stringify(result));
    """);   
    await flutterWebviewPlugin.close();
    return json.decode(publicKey);
  }

  Future<BigInt> generateSymmetricKey(BigInt privateKey, List<BigInt> publicKeys) async{
    BigInt combinedPublicKey = BigInt.parse("1");
    Map fullPublicKey = await generatePublicKey(privateKey.toString());
    BigInt publicKey = BigInt.parse(fullPublicKey["x2"]);
    for(var x = 0; x < publicKeys.length; x++)
      if(publicKeys[x] != publicKey)
        combinedPublicKey *= publicKeys[x];
    return (privateKey*combinedPublicKey)%p;
  }

  Future<Map> signMessage(String messageHash, BigInt privateKey) async{
    await launchUrlInWebview("", true);
    String signature = await flutterWebviewPlugin.evalJavascript(ellipticCurve+r"""
    const ec = new elliptic.ec('secp256k1');
    const privKey = ec.keyFromPrivate('"""+privateKey.toString()+r"""');
    const msgHash = '"""+messageHash+r"""';
    const signature = ec.sign(msgHash, privKey, "hex", {canonical: true});
    JSON.parse(JSON.stringify(signature));
    """);   
    await flutterWebviewPlugin.close();
    return json.decode(signature);
  }

